const cName = 'menu-item';
const menuItems = [
    {
        name: 'Today',
        path: '/',
        cName
    },
    {
        name: 'Calandar',
        path: '/',
        cName
    },
    {
        name: 'Projects',
        path: '/',
        cName
    },
    {
        name: 'Uncatgorized',
        path: '/',
        cName
    },
    {
        name: 'Tags',
        path: '/',
        cName
    },
    {
        name: 'Notebook',
        path: '/',
        cName
    },
]

export default menuItems;
